      "source" => "parseAccountType (account) {\n        const accountByType: Dict = {\n            'spot': 'Spot Wallet',\n            'swap': 'Futures Wallet',\n            'future': 'Futures Wallet',\n        };\n        return this.safeString (accountByType, account, account);\n    }"
